/*Table structure for table `event` */

DROP TABLE IF EXISTS `event`;

CREATE TABLE `event` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `customer_id` bigint(19) DEFAULT NULL,
  `module` varchar(20) DEFAULT NULL,
  `brand_id` bigint(19) DEFAULT NULL,
  `brand_category` varchar(45) DEFAULT NULL COMMENT '所属品牌分类,冗余',
  `category` varchar(45) DEFAULT NULL,
  `include` varchar(200) DEFAULT NULL,
  `exclude` varchar(200) DEFAULT NULL,
  `is_core` tinyint(1) DEFAULT '0',
  `status` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `k_u_idx` (`customer_id`) USING BTREE,
  CONSTRAINT `event_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `customer` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1094 DEFAULT CHARSET=utf8;

