/*Table structure for table `favorite` */

DROP TABLE IF EXISTS `favorite`;

CREATE TABLE `favorite` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `user_id` bigint(19) DEFAULT NULL,
  `module` varchar(20) DEFAULT NULL,
  `source` varchar(20) DEFAULT NULL,
  `favorite_at` datetime DEFAULT NULL,
  `sentiment_id` bigint(19) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  CONSTRAINT `favorite_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `favorite` */

/*Table structure for table `feedback` */

DROP TABLE IF EXISTS `feedback`;

CREATE TABLE `feedback` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `content` varchar(1000) DEFAULT NULL,
  `contacts` varchar(50) DEFAULT NULL,
  `feedback_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `submitter` bigint(19) DEFAULT NULL,
  `is_deal` tinyint(1) NOT NULL DEFAULT '0',
  `dealer` bigint(19) DEFAULT NULL,
  `deal_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `submitter` (`submitter`) USING BTREE,
  CONSTRAINT `feedback_ibfk_1` FOREIGN KEY (`submitter`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `feedback` */

/*Table structure for table `impression` */

DROP TABLE IF EXISTS `impression`;

CREATE TABLE `impression` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `customer_id` bigint(19) DEFAULT NULL,
  `month` int(6) DEFAULT NULL,
  `word` varchar(50) COLLATE utf8_bin DEFAULT NULL,
  `rate` int(3) DEFAULT '10',
  PRIMARY KEY (`id`)
