  `ranking` int(10) DEFAULT '0',
  `type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '论坛:luntan,新闻:xinwen,博客:boke',
  PRIMARY KEY (`id`),
  UNIQUE KEY `domain_unique` (`domain`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9080 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

