/*Table structure for table `report` */

DROP TABLE IF EXISTS `report`;

CREATE TABLE `report` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `type` varchar(20) DEFAULT NULL,
  `title` varchar(50) DEFAULT NULL,
  `summary` varchar(200) DEFAULT NULL,
  `resource_url` varchar(100) DEFAULT NULL,
  `user_id` bigint(19) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `apply_id` bigint(19) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `apply_id` (`apply_id`) USING BTREE,
  CONSTRAINT `report_ibfk_1` FOREIGN KEY (`apply_id`) REFERENCES `apply` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `report_ibfk_2` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `report` */

/*Table structure for table `reportsave` */

DROP TABLE IF EXISTS `reportsave`;

CREATE TABLE `reportsave` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `customer_id` varchar(255) DEFAULT NULL,
  `company_report` longtext,
  `create_time` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
