   renderChart($chartPanel, \'rose2\', chartData);\n    </div>\n</div>\n\n<br>\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 微信负面文章阅读数大部分在0-9区间。有关您企业或产品的微信负面信息尚未形成集中发力点，没有造成大规模负面效应。建议您时刻关注负面信息扩散态势，谨防信息升温发酵形成舆论焦点。\n\n\n### 3. 微博 ###\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">微博负面信息TOP3</th>\n    </tr>\n    <tr>\n        <td style=\"width: 30px\">序号</td>\n        <td style=\"width: 150px\">来源</td>\n        <td>博文摘要</td>\n        <td style=\"width: 100px\">转发数</td>\n    </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>1</td>\n            <td>营口达人会</td>\n            <td><a href=\"http://weibo.com/1837128641/FoyiBhCuc\" target=\"_blank\">【营口老边区一醉汉凌晨睡马路 警察給搀回家的】营口市老边区步</a></td>\n            <td>0</td>\n        </tr>\n        <tr>\n            <td>2</td>\n            <td>营口美食团</td>\n            <td><a href=\"http://weibo.com/3586691243/FofkK9539\" target=\"_blank\">营口身边事【营口老边区一醉汉凌晨睡马路 警察給搀回家的】</a></td>\n            <td>0</td>\n        </tr>\n        <tr>\n            <td>3</td>\n            <td>营口微资讯</td>\n            <td><a href=\"http://weibo.com/1918794514/FoyiAs3Je\" target=\"_blank\">【营口老边区一醉汉凌晨睡马路 警察給搀回家的】营口市老边区步</a></td>\n            <td>0</td>\n        </tr>\n    </tbody>\n</table>\n\n<div class=\"title-panel left\" style=\"\">\n    　　微博负面言论转发数分布\n</div>\n\n<div class=\"chart-panel left loading\" style=\"\">\n\n    <div class=\"script\">\n        var chartData = [{\"name\":\"0-9\",\"value\":5}];\n        renderChart($chartPanel, \'rose2\', chartData);\n    </div>\n</div>\n\n<br>\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 微博负面言论转发数大部分在0-9区间。有关您企业或产品的微博负面言论影响力比较小，不会对企业形象带来太大损害。普通网民关于企业的负面言论以吐槽居多，如对产品质量、售后服务等的牢骚抱怨，比较情绪化，网民往往不经思索就发布用来宣泄情感。企业应随时监测微博的负面信息，一旦发现大规模传播趋势，及时采取处置措施，将危机扼杀在萌芽状态。\n\n\n### 4. 论坛 ###\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">论坛负面信息TOP3</th>\n    </tr>\n    