h: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">博客负面信息TOP3</th>\n    </tr>\n    <tr>\n        <td style=\"width: 30px\">序号</td>\n        <td style=\"width: 150px\">来源</td>\n        <td>帖子标题</td>\n        <td style=\"width: 100px\">回复数</td>\n    </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>1</td>\n            <td>CSDN博客</td>\n            <td><a href=\"http://blog.csdn.net/chengmeng_123/article/details/74984116\" target=\"_blank\">mysql全国省市区县表（带经纬度）</a></td>\n            <td>0</td>\n        </tr>\n        <tr>\n            <td>2</td>\n            <td>CSDN博客</td>\n            <td><a href=\"http://blog.csdn.net/u011277123/article/details/53373944\" target=\"_blank\">mysql 省市县镇（乡)四级地区数据库</a></td>\n            <td>0</td>\n        </tr>\n        <tr>\n            <td>3</td>\n            <td>CSDN博客</td>\n            <td><a href=\"http://blog.csdn.net/guanjunhere/article/details/54630979\" target=\"_blank\">中国省市区县行政编码处理（转存在到数据库）</a></td>\n            <td>0</td>\n        </tr>\n    </tbody>\n</table>\n\n<br>\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 博客的负面信息传播能力非常低，建议保持实时监测，及时沟通回复。\n\n\n# 二、形象建设 #\n\n## 1. 官方官站 ##\n\n您的企业已建立官方网站，网址为【<a target=\"_blank\" href=\"http://gb.hnlytools.com/\">官网</a>】该网站给人的整体感受是舒服。以下是您的企业官网SEO综合检测结果：\n<br/>\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"8\">ALEXA排名</th>\n    </tr>\n    </thead>\n        <tbody>\n        <tr>\n            <th>整站世界排名：<span style=\"color:#f00\"></span></th>\n            <th> 整站流量排名：<span style=\"color:#f00\"></span></th>\n            <th>整站日均IP≈：<span style=\"color:#f00\"></span></th>\n            <th>整站日均PV≈：<span style=\"color:#f00\"></span></th>\n        </tr>\n        </tbody>\n</table>\n<br/>\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"10\">SEO指标</th>\n    </tr>\n    <tr>\n        <td>百度权重</td>\