# 四、信息流广告#\n\n## 1. 今日头条\n\n您的企业在今日头条自媒体没有内容营销。建议加强营销推广\n\n## 2. 天天快报\n\n您的企业在天天快报自媒体没有内容营销。建议加强营销推广\n\n\n## 3. 一点资讯\n\n您的企业在一点资讯自媒体没有内容营销。建议加强营销推广\n\n## 4. 搜狐新闻\n\n您的企业在搜狐自媒体没有内容营销，建议加强营销推广。\n\n## 5. 网易新闻\n\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">网易</th>\n    </tr>\n    <tr>\n        <td style=\"width: 30px\">序号</td>\n        <td style=\"width: 150px\">来源</td>\n        <td>报道标题</td>\n        <td style=\"width: 100px\">相似新闻数</td>\n    </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>1</td>\n            <td>网易</td>\n            <td><a href=\"http://hz.house.163.com/special/020703GE/news.html\" target=\"_blank\">首开杭州金茂府近期将加推1号、6号楼</a></td>\n            <td>2</td>\n        </tr>\n        <tr>\n            <td>2</td>\n            <td>网易</td>\n            <td><a href=\"http://3g.163.com/ntes/10/1027/09/6K0ALI2L00253B0H_1_1.html\" target=\"_blank\">鹏华信用增利债券型证券投资基金2010年第三季度报告</a></td>\n            <td>1</td>\n        </tr>\n        <tr>\n            <td>3</td>\n            <td>网易</td>\n            <td><a href=\"http://3g.163.com/ntes/10/0115/10/5T2ITCCO0009387A_2_1.html\" target=\"_blank\">海信的学费</a></td>\n            <td>1</td>\n        </tr>\n        <tr>\n            <td>4</td>\n            <td>网易</td>\n            <td><a href=\"http://shenzhen.news.163.com/17/0713/18/CP8DOOVF04178D6R.html\" target=\"_blank\">【八点易刻】土豪身家上亿开大奔捡3年垃圾 好人or作秀？</a></td>\n            <td>1</td>\n        </tr>\n        <tr>\n            <td>5</td>\n            <td>网易</td>\n            <td><a href=\"http://dy.163.com/v2/article/detail/CPF0MTTN0523HLLO.html\" target=\"_blank\">擒杀关羽 吴国马忠为何未成三国第一神将？</a></td>\n            <td>1</td>\n        </tr>\n    </tbody>\n</table>\n\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n您的企业对于网易自媒体平台的重视程度不是很高。相对于传统媒体，网易自媒体平台可以实现视频、图片、声音等媒介形式的的全方位传播，与用户进行实时交流沟通，内容形式丰富多彩，传播速度快，不再受制于地域、文化、群体的限制，达到开放式的传播。基于以上这些优势，建议您的企业增加网易自媒体平台的内容输出，加大企业的曝光，提升企业的知名度。\n\n\n## 6. 知乎\n\n<tab