>**\n\n1. 搜索指数直接反应了用户的兴趣和需求，做好了品牌推广，搜索指数自然上升。建议您依托基础媒介推广如百度推广、360推广、问答推广、B2B推广等在第三方平台大量发布含有企业品牌词的信息，增强品牌的曝光量。\n2. 同时，建议您在内容营销上加深用户对品牌的印象。内容营销的核心理念是将内容看做你的品牌资产，而非一次性的广告素材。每一次在新平台上对内容的重复利用，都可以有效优化你的品牌关键词，并降低内容生产成本。利用多样化内容与多元化渠道的组合，将为用户提供深化品牌记忆的最佳选择，实现“以逸待劳”的品牌传播。\n\n\n\n<br/>请联系客服：400-8800-275 QQ：3318460253获取解决方案。\n\n<div style=\"{float:right} \">（结束）</div>','2017-07-28 08:56:10'),(45,'175','本报告生成时间: 2017-08-07 07:37\n\n企业互联网形象检测得分为：\n25分，您的互联网形象非常糟糕，请尽快提升！\n以下是各部分的详细检测结果及改进建议：\n\n\n\n# 一、品牌维护 #\n## 1. 灾害信息 ##\n您的企业    近一月没有灾害信息\n\n## 2. 敏感信息 ##\n您的企业    近一月没有重点关注的敏感信息\n\n## 3. 负面信息 ##\n\n### 1. 新闻 ###\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">新闻负面信息TOP3</th>\n    </tr>\n    <tr>\n        <td style=\"width: 30px\">序号</td>\n        <td style=\"width: 150px\">来源</td>\n        <td>报道标题</td>\n        <td style=\"width: 100px\">相似新闻数</td>\n    </tr>\n    </thead>\n    <tbody>\n        <tr>\n            <td>1</td>\n            <td>卡宝宝网</td>\n            <td><a href=\"http://www.cardbaobao.com/cardnews/tag_5259.shtml\" target=\"_blank\">建行信用卡积分</a></td>\n            <td>63</td>\n        </tr>\n        <tr>\n            <td>2</td>\n            <td>国搜新闻</td>\n            <td><a href=\"http://news.chinaso.com/dupsearch.htm?csData=-414087251139296112&duptype=news\" target=\"_blank\">2017-07-27 -  中金在线理财频道</a></td>\n            <td>59</td>\n        </tr>\n        <tr>\n            <td>3</td>\n            <td>我爱卡</td>\n            <td><a href=\"http://www.51credit.com/wenda/110554.html\" target=\"_blank\">工商银行信用卡进度查询显示数据异常是什么意思</a></td>\n            <td>38</td>\n        </tr>\n    </tbody>\n</table>\n\n<div class=\"title-panel left\" style=\"\">\n    　　负面新闻报道媒体级别分布\n</div>\n\n<div class=\"chart-panel left loading\" style=\"\">\n\n    <div class=\"script\">\n        var chartData = [{\"name\":\"其他媒体\",\"value\":644},{\"name\":\"A级媒体\",\"value\":303},{\"name\":\"B级媒体\",\"value\":106},{\"name\":\"C级媒体\