  </tr>\n    </thead>\n</table>\n\n<div class=\"title-panel left\" style=\"\">\n    　　负面帖子论坛级别分布\n</div>\n\n<div class=\"chart-panel left loading\" style=\"\">\n\n    <div class=\"script\">\n        var chartData = ;\n        renderChart($chartPanel, \'rose2\', chartData);\n    </div>\n</div>\n\n<br>\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 论坛负面帖子。您的企业或产品在论坛的负面信息影响力比较小，建议保持实时监测，一旦发现负面帖子，及时回复解决问题，安抚用户情绪，树立企业客服态度的优秀典范。\n\n### 5. 贴吧 ###\n\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">贴吧负面信息TOP3</th>\n    </tr>\n    <tr>\n        <td style=\"width: 30px\">序号</td>\n        <td style=\"width: 150px\">来源</td>\n        <td>帖子标题</td>\n        <td style=\"width: 100px\">回复数</td>\n    </tr>\n    </thead>\n</table>\n\n<br>\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 贴吧的负面言论一般影响面不会太大，但因特别留意人气贴吧的负面，注意及时沟通引导处理好用户投诉。如果碰到恶意抹黑的负面言论，且有全面爆发的苗头，建议启动危机公关。\n\n### 6. 博客 ###\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <th colspan=\"4\">博客负面信息TOP3</th>\n    </tr>\n    <tr>\n        <td style=\"width: 30px\">序号</td>\n        <td style=\"width: 150px\">来源</td>\n        <td>帖子标题</td>\n        <td style=\"width: 100px\">回复数</td>\n    </tr>\n    </thead>\n</table>\n\n<br>\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 博客的负面信息传播能力非常低，建议保持实时监测，及时沟通回复。\n\n\n# 二、形象建设 #\n\n## 1. 官方官站 ##\n\n您的企业尚未建立官方网站。在这个互联网迅速发展的时代，企业官网已然成为企业门面的象征。客户想了解企业的情况，第一步是肯定是通过网络搜索这家企业的信息，如果企业连官方网站都没有，客户无疑会对企业的实力产生怀疑。建议您立即组建团队或联系专业网站建设人员，建立企业的官网。官网使企业具有网络宣传能力，企业可以把任何想让公众了解的内容放入网站。另一方面，拥有官网就拥有网络沟通能力，企业可利用官网及时得到客户反馈，同时也可与潜在客户建立商业联系。\n\n## 2. 微信公众号 ##\n\n您的企业尚未建立官方微信订阅号。如今微信发展势头迅猛，用户数超过9亿，成为大众社交首选。微信因其社交属性和熟人网络的特性，在品牌推广方面有着其他媒体无可比拟的优势，在这个人人抢滩微信营销的时代，企业如果还固步自封，死守传统媒体，迟早会被淘汰。建议您的企业尽快注册微信订阅号，使企业与用户的沟通更及时、更灵活、更精准。\n\n## 3. 微博账号 ##\n\n您的企业尚未建立官方认证微博。如今，微博以其“碎片化”的信息蔓延渗透到生活的众多领域，是人们获取信息的主要渠道之一，建议您尽快建立企业认证微博，把握网络营销的主动性和时效性，传播企业品牌、产品的最新资讯；与消费者建立及时沟通和良好互动，贴近用户生活，增强用户黏度。\n\n## 4. 百度百科 ##\n\n您的企业尚未建立百度百科词条，百科词条权威性高、转化率高，是企业推广的重要窗口，建议您尽快创建与企业或产品相关的词条。可借助百度百科代写服务，进行企业品牌的知识包装和宣传，让更多的人关注企业品牌的发展提高品牌知名度。\n\n\n## 5. 360百科 ##\n\n## 6. 搜狗百科 ##\n\n# 三、软文营销\n\n## 1. 新闻门户 ##\n\n<br/>近一月暂未发现具影响力的新闻媒体对您的企业或产品进行传播报道。\n\n## 2. 微信公众号 ##\n<br/>近一月暂未发现具影响力的微信公众号对您的企业或产品进行传播。\n\n## 3. 微博大号 ##\n<br/>近一月暂未发现具影响力的微博大V对您的企业或产品进行传播。\n\n## 4. 论坛 ##\n<br/>近一月暂未发现具影响力的论坛对您的企业或产品进行传播。\n\n## 5. 贴吧 ##\n\n<br/>近一月暂未发现具影响力的贴吧对您的企业或产品进行传播。\n\n## 6. 博客 ##\n\n<br/>近一月暂未发现具影响力的博客对您的企业或产品进行传播。\n\n\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 建议您的企业借助具影响力的新闻媒体进行传播。企业通过新闻媒体发稿报道，主要是为了达到树立口碑形象、塑造典型案例、制造热点话题等目的，行业影响力大的新闻媒体刊发的报道更在用户心中更具真实性和权威性，容易让人信服；其报道也更容易被其他媒体转载，能起到搜索引擎优化作用。特别是一些行业标杆性媒体，读者都是对行业感兴趣的目标人群，在这些媒体精准投放更能提高转化率。\n1. 建议您的企业借助具影响力的微博大V进行传播。微博大V作为意见领袖，在粉丝中拥有非常高的话语权，大V的一次发布或转发能瞬间触发众多粉丝的追随转发，引起爆发性曝光。巨大的曝光量加上微博本身的高质量内容，很容易形成一种病毒式的连锁反应，对企业品牌推广来说，收益相当可观。\n1. 建议您的企业借助具影响力的微信公众号进行传播。微信公众号的媒体定位是内容精选、受众精确，通过微信红人大号、行业标杆大号等优质微信资源对企业的产品、品牌、文化等进行精准推广宣传，达到提升品牌关注度、引导客户需求、挖掘潜在客户、引流网站点击量的多方位宣传效果。\n1. 建议您的企业借助具影响力的论坛进行传播。论坛软文投放具备门槛低、见效快、发布易、覆盖广等优势，能有效助力企业品牌推广，帮助企业培育客户忠诚度，及时充分地进行双向信息沟通。论坛推广最关键是用户群要精准，首先要选择目标人群聚集最多的论坛，如行业相关论坛，外链的质量会高一些；其次要人气旺、用户活跃度高，以保证帖子曝光度和回复数。\n1. 建议您的企业借助具影响力的论坛进行传播。论坛软文投放具备门槛低、见效快、发布易、覆盖广等优势，能有效助力企业品牌推广，帮助企业培育客户忠诚度，及时充分地进行双向信息沟通。论坛推广最关键是用户群要精准，首先要选择目标人群聚集最多的论坛，如行业相关论坛，外链的质量会高一些；其次要人气旺、用户活跃度高，以保证帖子曝光度和回复数。\n1. 建议您的企业借助具影响力的论坛进行传播。论坛软文投放具备门槛低、见效快、发布易、覆盖广等优势，能有效助力企业品牌推广，帮助企业培育客户忠诚度，及时充分地进行双向信息沟通。论坛推广最关键是用户群要精准，首先要选择目标人群聚集最多的论坛，如行业相关论坛，外链的质量会高一些；其次要人气旺、用户活跃度高，以保证帖子曝光度和回复数。\n\n# 四、信息流广告#\n\n## 1. 今日头条\n\n您的企业在今日头条自媒体没有内容营销。建议加强营销推广\n\n## 2. 天天快报\n\n您的企业在天天快报自媒体没有内容营销。建议加强营销推广\n\n\n## 3. 一点资讯\n\n您的企业在一点资讯自媒体没有内容营销。建议加强营销推广\n\n## 4. 搜狐新闻\n\n您的企业在搜狐自媒体没有内容营销，建议加强营销推广。\n\n## 5. 网易新闻\n\n您的企业在网易自媒体没有内容营销。建议加强营销推广\n\n## 6. 知乎\n\n您的企业在知乎自媒体没有内容营销。建议加强营销推广\n\n\n\n\n# 五、搜索指数 #\n\n   网民关注度最直接地反映在网民的搜索行为上，而搜索指数是衡量网民搜索行为的重要依据。搜索指数是以网民在百度、360等搜索引擎的搜索量为数据基础，以关键词为统计对象，科学分析并计算出关键词在网页搜索中搜索频次的加权和。以下是您企业近几个月的搜索指数对比：\n\n## 1. 百度指数\n\n<div class=\"chart-panel loading\" style=\"\">\n    <div c