\n        事件/借势/热点营销:10%;\n        活动营销:30%;\n        原创文章/段子:1%;\n        创意图文/视频:12%;\n        行业资讯:38%;\n        社会热点:9%;\n    】类型的文章。\n    分布如下图：\n<div class=\"chart-panel loading\" style=\"\">\n        <div class=\"script\">\n            var chartData = [{\"name\":\"事件/借势/热点营销\",\"value\":0.1},{\"name\":\"活动营销\",\"value\":0.3},{\"name\":\"原创文章/段子\",\"value\":0.01},{\"name\":\"创意图文/视频\",\"value\":0.12},{\"name\":\"行业资讯\",\"value\":0.38},{\"name\":\"社会热点\",\"value\":0.09}];\n            renderChart($chartPanel, \'pie2\', chartData);\n        </div>\n</div>\n\n\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 您的企业微信订阅号    更新频率非常低，给用户造成运营人员极不专业的印象。当务之急是提高更新频率，如果企业人力资源紧张，可交给专业团队托管。\n2. 您的企业微信订阅号    阅读数非常低，若要实现大众传播的理想效果，应抓住自主选择的权力主体，即微信订阅号用户，同时综合运用多种传播策略。建议企业先明确微信订阅号的定位，根据定位属性锁定目标人群，了解他们最想从你的文章里获取什么，对症下药，解决用户痛点，这样阅读数自然会得到提升。\n3. \n    优质的内容输出是微信订阅号的长盛不衰的法宝，通过推送优质内容可扩大用户基数并使受众对品牌产生好感和信任，增强用户的黏性。在知识膨胀的今天，只有不间断的原创内容才具备核心竞争力，建议您借助专业团队的力量，持续地打造一个干货丰盈、视角新颖、情怀十足的微信订阅号。\n\n\n## 3. 微博账号 ##\n\n您的企业有官方认证微博[<a target=\"_blank\"\n                                     href=\"http://weibo.com/2171207471\">@竞网科技</a>].该微博当前粉丝数为8,187;近一月共发微博0篇，更新频率大致为半月以上\n,\n分布如下图:\n<div class=\"chart-panel loading\" style=\"\">\n    <div class=\"script\">\n        var chartData = [];\n        renderChart($chartPanel, \'bar2\', chartData);\n    </div>\n</div>\n\n您的企业微博近一月平均转发数为0,微博整体内容质量毫无亮点，主要发布【\n        行业资讯:18%;\n                乏善可陈:82%;\n        】类型的文章。\n    分布如下图：\n    <div class=\"chart-panel loading\" style=\"\">\n        <div class=\"script\">\n            var chartData = [{\"name\":\"行业资讯\",\"value\":0.18},{\"name\":\"乏善可陈\",\"value\":0.82}];\n            renderChart($chartPanel, \'pie2\', chartData);\n        </div>\n    </div>\n\n**<span style=\"color:#f00\">诊断与建议：</span>**\n\n1. 您的企业微博    粉丝基础非常薄弱，影响企业形象，建议在短时间内提高粉丝数。\n\n2. 您的企业微博    更新频率非常低，亟需提高更新频率，如企业人力资源紧张，可交给专业团队托管。\n\n3. 您的企业微博\n    传播度非常低，建议以对网民心理的深刻洞察为原点，创造优质内容、策划营销活动，用情绪价值和利益回馈驱动网民的参与热情。\n\n4. 您的企业微博\n    尚未掌握内容运营的方法，内容运营需要掌握趣味、利益、个性三个原则：一是内容要有足够的趣味和新意；二是发布的信息具有实用性，能帮助用户解决困难；三是企业发布的微博内容要自成体系，有独树一帜的个性并能长期保持一致性，使用户能一眼识别。这些都需要专业团队花充足的时间，进行巧妙地构思和创意。敷衍地发布行业资讯、社会热点、养生保健、心灵鸡汤等千篇一律的雷同内容，不会获得用户持久关注，甚至会引起用户反感。因此，建议您的企业积极探索微博运营新模式，结合社会热点，多从事件/借势/热点营销、活动营销、原创内涵段子、创意图文等形式创造有传播价值的内容。\n\n\n\n## 4. 百度百科 ##\n\n您的企业已建立百度百科词条：【湖南竞网智赢网络技术有限公司】，但词条内容不完整。百科词条权威性高、转化率高，是企业推广的重要窗口，建议您尽快完善词条内容，注意体现公司荣誉和核心价值。\n\n\n## 5. 360百科 ##\n\n## 6. 搜狗百科 ##\n\n# 三、软文营销\n\n## 1. 新闻门户 ##\n\n<br/>近一月有以下具有影响力的新闻媒体对您的企业或产品进行了传播报道：\n\n\n\n<table border=\"1\" style=\"width: 100%\">\n    <thead style=\"white-space: nowrap;\">\n    <tr>\n        <td style=\"width: 150px\">网媒</td>\n        <td>报道标题</td>\n    </tr>\n    </thead>\n\n    <tbody>\n        <tr>\n            <td>网易新闻</td>\n            <td><a href=\"http://news.163.com/17/1013/23/D0LQI12K000187VG.html\" target=\"_blank\" >【盛开的梦想】网络大咖5招破解中小企业触网难题</a></td>\n        </tr>\n        <tr>\n            <td>360新闻</td>\n            <td><a href=\"http://sh.qihoo.com/pc/detail?check=380ef2214c03f1ff&sign=360_e39369d1&url=http://www.yidianzixun.com/article/0HVXSlAf\" target=\"_blank\" >海南昌江十月田互联网农业小镇启动 | 行业新闻精选</a></td>\n        </tr>\n        <tr>\n            <td>凤凰资讯</td>\n            <td><a href=\"http://news.ifeng.com/a/20170920/52088448_0.shtml\" target=\"_blank\" >湖南产业互联网创新生态联盟成立、百创(长沙)创新中心正式揭牌</a></td>\n        </tr>\n        <tr>\n            <td>凤凰资讯</td>\n            <td><a href=\"http://news.ifeng.com/a/20170921/52109684_0.shtml\" target=\"_blank\" >2017产业互联网创新大会在长沙召开</a></td>\n        </tr>\n        <tr>\n            <td>凤凰资讯</td>\n            <td><a href=\"http://news.ifeng.com/a/20170920/52093978_0.shtml\" target=\"_blank\" >湖南产业互联网创新生态联盟成立</a></td>\n        </tr>\n        <tr>\n            <td>网易新闻</td>\n            <td><a href=\"http://news.163.com/17/0921/10/CURPGGK6000187VG.html\" target=\"_blank\" >百度（长沙）创新中心揭牌</a></td>\n        </tr>\n        <tr>\n            <td>百度新闻</td>\n            <td><a href=\"http://news.baidu.com/ns?word=%E9%BB%84%E9%9F%AC&pn=0&cl=2&ct=0&t