/*Table structure for table `seo` */

DROP TABLE IF EXISTS `seo`;

CREATE TABLE `seo` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `customer_id` bigint(19) NOT NULL,
  `date` int(8) NOT NULL,
  `website` varchar(255) NOT NULL,
  `world_rank` varchar(15) DEFAULT NULL COMMENT '网站世界排名',
  `traffic_rank` varchar(15) DEFAULT NULL COMMENT '整站流量排名',
  `day_average_ip` varchar(15) DEFAULT NULL COMMENT '整站日均IP≈',
  `day_average_pv` varchar(15) DEFAULT NULL COMMENT '整站日均PV≈',
  `baidu_traffic` varchar(15) DEFAULT NULL COMMENT '百度流量预计',
  `key_words` varchar(15) DEFAULT NULL COMMENT '关键词库',
  `baidu_snapshot` varchar(15) DEFAULT NULL COMMENT '百度快照',
  `home_location` varchar(15) DEFAULT NULL COMMENT '首页位置',
  `index_quantity` varchar(15) DEFAULT NULL COMMENT '索引量',
  `today_included` varchar(15) DEFAULT NULL COMMENT '今日收录',
  `last_week` varchar(15) DEFAULT NULL COMMENT '最近一周',
  `last_month` varchar(15) DEFAULT NULL COMMENT '最近一月',
  `title_length` varchar(40) DEFAULT NULL COMMENT '标题长度',
  `title_content` varchar(300) DEFAULT NULL COMMENT '标题内容',
  `title_suggest` varchar(250) DEFAULT NULL COMMENT '标题优化建议',
  `key_words_length` varchar(40) DEFAULT NULL COMMENT '关键词长度',
  `key_words_content` varchar(300) DEFAULT NULL COMMENT '关键词内容',
  `key_words_suggest` varchar(250) DEFAULT NULL COMMENT '关键词建议',
  `describe_length` varchar(40) DEFAULT NULL COMMENT '描述长度',
  `describe_content` varchar(300) DEFAULT NULL COMMENT '描述内容',
  `describe_suggest` varchar(300) DEFAULT NULL COMMENT '描述建议',
  `keyword_array` varchar(4000) DEFAULT NULL COMMENT '关键字列表',
  `baidu_weight` int(20) DEFAULT NULL COMMENT '百度权重',
  `baidu_nofollow` int(20) DEFAULT NULL COMMENT '百度反链数',
