insert  into `special`(`id`,`type`,`customer_id`,`sentiment_id`,`date_`,`is_read`,`url`,`title`,`content`,`tonality`,`created_at`,`user_id`,`username`,`nickname`,`followers`,`is_vip`,`vip_type`,`repost_count`,`comment_count`,`reads_`,`source_`,`platform`,`media`,`images`,`videos`,`status`,`degree`,`likes`,`sames_`,`website_name`) values (195955,'alarm',2,5070276572610243421,20171025,0,'http://www.sohu.com/a/200089858_115239','【理上网来·辉煌十九大】缅甸民主党秘书长:十九大为发展中国家提供了治国理...','原标题：【理上网来·辉煌十九大】缅甸民主党秘书长：十九大为发展中国家提供了治国理政经验   \n民主党缅甸秘书长丹丹努接受<span style=\'color:#f00\'>记者</span>专访  \n国际在线报道（<span style=\'color:#f00\'>记者</span> 洪荃诠）：这几天，缅甸各党派都一直关注着中国共产党第十九次全国代表大会的进展。缅甸民主党（缅甸）秘书长丹丹努在接受<span style=\'color:#f00\'>记者</span>专访时表示，习近平所作的十九大报告为包括缅甸在内的发展中国家提供了治国理政经验。反<span style=\'color:#f00\'>腐败</span>斗争取得了重要成果就是最好的证明。我看到了习近平对<span style=\'color:#f00\'>腐败</span>现象零容忍的决心。我认为，反腐工作不能因为官职大小而区别对待，中国共产党做到了这一点，只要有<span style=\'color:#f00\'>贪污</span><span style=\'color:#f00\'>腐败</span>行为，一定依法依规处置，因而赢得了民心。','positive','2017-10-25 14:02:00',NULL,NULL,NULL,0,0,NULL,0,0,0,NULL,'新闻',NULL,'',NULL,'0',100,0,1,'搜狐'),(195956,'alarm',2,984042383335745980,20171025,0,'http://news.china.com/focus/19da/zuixin/13001172/20171025/31602052.html','泰国副总理:中共十九大报告\"四个新\"值得关注','中新社曼谷10月25日电(<span style=\'color:#f00\'>记者</span>王国安)泰国副总理威萨努24日在总理府接受中国驻泰媒体集体采访时表示，中共十九大对中国和世界的发展意义重大。过去五年，中国行之有效的反<span style=\'color:#f00\'>腐败</span>斗争就是一个很好的例证。','positive','2017-10-25 14:44:00',NULL,'( 责任编辑：李皓 CN002)',NULL,0,0,NULL,0,0,0,NULL,'新闻',NULL,'',NULL,'0',100,0,1,'中华网新闻频道'),(195958,'alarm',2,-4388044122558707300,20171023,0,'http://weibo.com/5972831780/FrKDm1PHW','【十九大释放八大重磅反腐信号】十八大以来的这五年，我们党正风','【十九大释放八大重磅反腐信号】十八大以来的这五年，我们党正风肃纪、反腐惩恶，如今反<span style=\'color:#f00\'>腐败</span>斗争压倒性态势已经形成并巩固发展。十九大之后，反<span style=\'color:#f00\'>腐败</span>将如何推进，反腐工作重点在哪里？从十九大报告到十九大新闻中心举行的首场<span style=\'color:#f00\'>记者</span>招待会，八大重磅反腐信号已经明确。','positive','2017-10-23 22:28:00','5972831780','正义阆中',NULL,2273,0,NULL,0,0,0,NULL,'微博',NULL,NULL,NULL,'0',0,0,1,'新浪微博'),(195959,'alarm',2,3747873344187138183,20171023,0,'http://weibo.com/3183107112/FrKuV1gYk','十九大特别报道【十九大释放八大重磅反腐信号】十八大以来的','#十九大特别报道#【十九大释放八大重磅反腐信号】十八大以来的这五年，我们党正风肃纪、反腐惩恶，如今反<span style=\'color:#f00\'>腐败</span>斗争压倒性态势已经形成并巩固发展。十九大之后，反<span style=\'color:#f00\'>腐败</span>将如何推进，反腐工作重点在哪里？从十九大报告到十九大新闻中心举行的首场<span style=\'color:#f00\'>记者</span>招待会，八大重磅反腐信号已经明确。','positive','2017-10-23 22:08:00','3183107112','检察日报',NULL,1469985,0,NULL,35,1,0,NULL,'微博',NULL,NULL,NULL,'0',43,7,1,'新浪微博'),(195960,'alarm',160,1074670074656318768,20171004,0,'http://ts.voc.com.cn/question/view/546579.html','西北大宗商品交易中心第79号会员单位成都大有荣逸骗我血汗钱','一对一指导喊单进行西北油，西北银的买卖操作，造成我几天资金损失7.6万元，事后我在<span style=\'color:#f00\'>百度</span>搜索到很多篇网友帖子才发现这是个骗局，也就是网络金融诈骗。期间我<span style=\'color:#f00\'>投诉</span>到成都市政府信箱，今年7月18日西北大宗商品交易中心第79号会员单位成都大有荣逸商务信息咨询有限公司.负责人雷伟主动联系我，雷伟表示愿意和解，退赔我被骗的损失。成都大有荣逸商务信息咨询有限公司的办公址:成都市高新区环球中心E3区3一2一801， 028-63173024.<span style=\'color:#f00\'>投诉</span>人，张萍，电话13612820744','positive','2017-10-04 06:39:00',NULL,NULL,NULL,0,0,NULL,0,0,4028,NULL,'新闻',NULL,'',NULL,'0',100,0,1,'投诉直通车');

