/*Table structure for table `user_customer` */

DROP TABLE IF EXISTS `user_customer`;

CREATE TABLE `user_customer` (
  `user_id` bigint(19) DEFAULT NULL,
  `customer_id` bigint(19) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `user_customer` */

insert  into `user_customer`(`user_id`,`customer_id`) values (1,1),(1,2);

/*Table structure for table `weather` */

DROP TABLE IF EXISTS `weather`;

CREATE TABLE `weather` (
  `id` bigint(19) NOT NULL AUTO_INCREMENT,
  `date` int(11) DEFAULT NULL,
  `degree` int(11) DEFAULT NULL,
  `condition` varchar(10) COLLATE utf8_bin DEFAULT NULL,
  `calamity` int(11) DEFAULT NULL,
  `warnings` int(11) DEFAULT NULL,
  `customer_id` bigint(19) DEFAULT NULL,
  `positives` int(11) DEFAULT NULL,
  `negatives` int(11) DEFAULT NULL,
  `neutral` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

